import React from "react";

function Card({ name, link, likes, id, onDeleteClick }) {

  return (
    <li className="card">
      <img className="card__image" alt="Pic: " src={link} />
      <div className="card__text-container">
        <p className="card__text">{name}</p>
        <div className="card__likes-container">
          <button className="button button_like" />
          <p className="card__likes-text">{likes}</p>
        </div>
      </div>
      <button className="button button_delete" onClick={onDeleteClick} />
    </li>
  );
}

export default Card;
